def strStr(haystack, needle):

    if needle == "":
        print(1)
        return 0
    
    if needle == haystack:
        print(2)
        return 0

    if len(needle) >= len(haystack):
        print(3)
        return -1

    hash_n = hash(needle)

    for i in range(0, 1+len(haystack)-len(needle)):
        j = 0
        if hash(haystack[i:i+len(needle)]) == hash_n:
            while j < len(needle):
                if haystack[i+j] == needle[j]:
                    if j == len(needle) - 1:
                        return i
                    j += 1
                    continue
                else:
                    break
            
    return -1





